  circle.attr('r', height / 2);
  circle.attr('fill', 'yellow');
  circle.attr('stroke', 'black');

  const eyeSpacing = 101;
  const eyeYOffset = -89;
  const eyeRadius = 40;
  const eyebrowWidth = 70;
  const eyebrowHeight = 20;
